--
-- Name: atualizaFaixaDelete(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION "atualizaFaixaDelete"() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
declare ult bigint;
begin
  select max(numero) as ultima from autorizacoes where id_faixa = old.id_faixa into ult;
  update faixas set saldo = (saldo +1);
  update faixas set ultima = ult where id = old.id_faixa;
  return null;
end
$$;


ALTER FUNCTION public."atualizaFaixaDelete"() OWNER TO postgres;

