--
-- Name: atualizaSaldos(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION "atualizaSaldos"() RETURNS integer
    LANGUAGE plpgsql
    AS $$ DECLARE result RECORD;
 DECLARE _id      integer;
 DECLARE _geradas integer;
 DECLARE _usadas  integer;
 DECLARE _saldo   integer;
 DECLARE usadas   record;
begin
  FOR result IN EXECUTE('SELECT id, (final - inicial) +1 as geradas FROM faixas order by id')
  LOOP
    _id      = result.id;
    _geradas = result.geradas;
    EXECUTE('select count(numero) from autorizacoes where id_faixa='||_id||'') into _usadas;
    _saldo  = (_geradas - _usadas);
    EXECUTE ('update faixas set saldo='||_saldo||' where id = '||_id||'');
    EXECUTE ('update faixas set ultima=(select coalesce(max(autorizacoes.numero), 0) as ultima from autorizacoes where autorizacoes.id_faixa = '||_id||') where id='||_id||'');
  END LOOP;
  RETURN null;
end;
$$;


ALTER FUNCTION public."atualizaSaldos"() OWNER TO postgres;

--
-- Name: atualiza_aih_por_competencia(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION atualiza_aih_por_competencia() RETURNS integer
    LANGUAGE plpgsql
    AS $$
  DECLARE result RECORD;  DECLARE wret int;  DECLARE wcmp varchar(6);  DECLARE wid int;
begin
  FOR result IN EXECUTE('SELECT id, ano||mes as cmpt FROM competencias order by id')
  LOOP
      wret = wret + 1;
      wcmp = result.cmpt;
      wid  = result.id;
      EXECUTE ('update autorizacoes set id_competencia='||wid||' where cmpt_aih='''||wcmp||'''');
      raise notice 'Competência: %', wcmp;
  END LOOP;
  RETURN wret;
end;
$$;


ALTER FUNCTION public.atualiza_aih_por_competencia() OWNER TO postgres;

