--
-- Name: atualiza_aih_por_faixa(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION atualiza_aih_por_faixa() RETURNS integer
    LANGUAGE plpgsql
    AS $$  DECLARE result RECORD; DECLARE wret int; DECLARE ini bigint; DECLARE fim bigint; DECLARE wid int;
begin
  FOR result IN EXECUTE('SELECT id, inicial, final FROM faixas order by id')
  LOOP
    wret := wret + 1; ini  := result.inicial; fim  := result.final; wid  := result.id;
    EXECUTE ('update autorizacoes set id_faixa='||wid||' where cast(num_aih as bigint) >= '||ini||' and cast(num_aih as bigint) <= '||fim||' and id_faixa=0');
    raise notice 'Id: %', wid;
  END LOOP;
  RETURN wret;
end;
$$;


