--
-- Name: atualiza_saldo_insert(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION atualiza_saldo_insert() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
declare saldo_antigo double precision;
declare valor_atual double precision;
declare novo_saldo double precision;
begin
  select valor_saldo from tetos_por_estabelecimento where id_estabelecimento = new.id_estabelecimento and id_competencia = new.id_competencia into saldo_antigo;
  select (valor_sh + valor_sp + valor_sa) from procedimentos where id = new.id_procedimento and id_competencia = new.id_competencia into valor_atual;
  novo_saldo = (saldo_antigo - valor_atual);

  update tetos_por_estabelecimento set valor_saldo = novo_saldo where id_estabelecimento = new.id_estabelecimento and id_competencia = new.id_competencia;
  RETURN NULL;
end;
$$;


ALTER FUNCTION public.atualiza_saldo_insert() OWNER TO postgres;

