--
-- Name: atualiza_ultima_por_faixa(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION atualiza_ultima_por_faixa() RETURNS integer
    LANGUAGE plpgsql
    AS $$
 DECLARE result RECORD; declare ultima RECORD; DECLARE retorno int;
begin
  FOR result IN EXECUTE('SELECT id FROM faixas order by id')
  LOOP
    EXECUTE ('update faixas set ultima=(select coalesce(max(numero),0) as ultima from autorizacoes where id_faixa='||result.id||') where id='||result.id||'');
    raise notice 'Id: %', result.id;
  END LOOP;
  EXECUTE ('update faixas set ultima=(inicial -1) where ultima=0');
  RETURN retorno;
end;
$$;


