--
-- Name: atualizasaldofinanceiro(integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION atualizasaldofinanceiro(_estabelecimento integer, _competencia integer) RETURNS double precision
    LANGUAGE plpgsql
    AS $$declare teto  double precision;
declare valor double precision;
declare saldo double precision;
begin
  select tetos_por_estabelecimento.valor_teto
  from estabelecimentos
  inner join tetos_por_estabelecimento on estabelecimentos.id = tetos_por_estabelecimento.id_estabelecimento
  where estabelecimentos.id = _estabelecimento and tetos_por_estabelecimento.id_competencia = _competencia into teto;
  
  select coalesce(sum(procedimentos.valor_sp + procedimentos.valor_sa + procedimentos.valor_sh), 0.00) as soma
  from autorizacoes
  inner join procedimentos on autorizacoes.id_procedimento = procedimentos.id and autorizacoes.str_competencia=procedimentos.cmpt
  where autorizacoes.id_estabelecimento = _estabelecimento and autorizacoes.id_competencia = _competencia into valor;

  saldo = teto - valor;
  update tetos_por_estabelecimento set valor_saldo = saldo where id_estabelecimento= _estabelecimento and id_competencia = _competencia;
  return null;
end;
$$;


ALTER FUNCTION public.atualizasaldofinanceiro(_estabelecimento integer, _competencia integer) OWNER TO postgres;

